import sympy

a, b, c, d, e, f = sympy.symbols('a b c d e f')
s1, s2, s3, s4 = sympy.symbols('s1 s2 s3 s4')
x = (-b + s1**.2 + s2**.2 + s3**.2 + s4**.2)/(5*a)
function = a*x**5 + b*x**4 + c*x**3 + d*x**2 + e*x + f
print(sympy.expand(function*3125*a**4))

